import React from "react";

const Services: React.FC = () => {
  return (
    <section id="services" className="py-20 bg-gray-100">
      <div className="container mx-auto px-4 text-center">
        <h3 className="text-3xl font-semibold mb-8">Our Services</h3>
        <div className="grid gap-8 md:grid-cols-3">
          <div className="bg-white p-6 rounded-lg shadow-md">
            <h4 className="text-xl font-bold mb-2">Consulting</h4>
            <p>Expert business and technical consulting for modern enterprises.</p>
          </div>
          <div className="bg-white p-6 rounded-lg shadow-md">
            <h4 className="text-xl font-bold mb-2">Software Development</h4>
            <p>Custom software solutions tailored to your business needs.</p>
          </div>
          <div className="bg-white p-6 rounded-lg shadow-md">
            <h4 className="text-xl font-bold mb-2">Support & Maintenance</h4>
            <p>Reliable IT support and maintenance services.</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Services;
